import React from "react";
import ReactDOM from "react-dom";

class Footer extends React.Component {
  render() {
    return (
      <div style={{ backgroundColor: "#f5f8fd" }}>
        <div className="container pt-5">
          <div className="row">
            <div className="col-md-6">
              <div className="row">
                <div className="col-md-6">
                  <p className="text-uppercase h1 font-weight-light"> rapid </p>
                  <div className="text-muted pt-3 pb-3 small">
                    Lorem ipsum dolor sit amet consectetur adipisicing elit.
                    Officia dicta nemo sed ducimus quisquam. Impedit cumque
                    totam deleniti optio voluptatem nobis, tempore sed a
                    expedita. Eveniet exercitationem autem atque ab?
                  </div>

                  <p className="small font-weight-bold text-uppercase">
                    {" "}
                    our newsletter
                  </p>
                  <p className=" small  pb-3">
                    Lorem, ipsum dolor sit amet consectetur adipisicing elit. Et
                    id quam reiciendis quod quis, aspernatur, obcaecati veniam
                    necessitatibus placeat minus voluptatum nam rem doloremque
                    voluptate explicabo neque blanditiis ab deleniti.
                  </p>
                </div>

                <div className="col-md-6">
                  <p className="text-uppercase small font-weight-bold">
                    {" "}
                    useful links
                  </p>
                  <ul className="list-unstyled">
                    <li className="text-capitalize pt-1 pb-1 text-muted">
                      {" "}
                      home{" "}
                    </li>
                    <li className="text-capitalize pt-1 pb-1"> about us </li>
                    <li className="text-capitalize pt-1 pb-1">services </li>
                    <li className="text-capitalize pt-1 pb-1">
                      {" "}
                      term of service{" "}
                    </li>
                    <li className="text-capitalize pt-1 pb-1">
                      {" "}
                      private policy{" "}
                    </li>
                  </ul>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Footer;
